#include <bits/stdc++.h>
using namespace std;

const int C = 150000;
const string A = "";

inline uint32_t f(int x, int y) {
	return stoul(A.substr(x * 32 + y * 8, 8), 0, 16);
}

int main() {
	cin.tie(0), ios_base::sync_with_stdio(0);
	uint32_t n, a, b, c, d; cin >> n >> a >> b >> c >> d;
	auto w = f(n / C, 0), x = f(n / C, 1), y = f(n / C, 2), z = f(n / C, 3);
	for (uint32_t i = n / C * C + 1; i <= n; i++) {
		uint32_t xx = i;
		for (int j = 2; j * j <= xx; j++) {
			if (xx % j == 0) {
				uint32_t cnt = 0;
				while (xx % j == 0) xx /= j, cnt++;
				w += cnt * j * j * j;
				x += cnt * j * j;
				y += cnt * j;
				z += cnt * 1;
			}
		}
		if (xx != 1) {
			w += xx * xx * xx;
			x += xx * xx;
			y += xx;
			z += 1;
		}
	}
	cout << a * w + b * x + c * y + d * z;
}
